INSERT INTO `homepage_sections` VALUES (1,'hero','القاسم العقارية','شريكك الموثوق في عالم العقارات','{\"backgroundImage\": \"https://manus-storage.oss-cn-beijing.aliyuncs.com/user-file/e8c3c3a1-1b7c-4e7c-a2ff-d1a4d1e1a5b1/real-estate-hero.jpg\", \"heading\": \"ابحث عن عقارك مع القاسم\", \"stats\": [{\"label\": \"عقار متاح\", \"value\": \"+500\"}, {\"label\": \"عميل سعيد\", \"value\": \"+1200\"}, {\"label\": \"مشروع منجز\", \"value\": \"+50\"}, {\"label\": \"سنة خبرة\", \"value\": \"+25\"}], \"subheading\": \"نقدم أفضل تجربة في البحث عن العقارات المميزة في المملكة العربية السعودية\"}',1,1,'2026-02-13 05:07:01',NULL),(2,'about','من نحن','شركة القاسم العقارية','{\"description\": \"يقوم مبدأ العمل في شركة محمد بن عبد الرحمن القاسم العقارية على السمعة الطيبة والعلاقات الإيجابية مع العملاء من خلال ترسيخ مفهوم الصدق والنزاهة في العمل وتحقيق الوعود والتطلعات أياً كانت.\", \"stats\": [{\"label\": \"سنة خبرة\", \"value\": \"+20\"}, {\"label\": \"وحدة مباعة\", \"value\": \"+1000\"}, {\"label\": \"مشروع مكتمل\", \"value\": \"+16\"}, {\"label\": \"قيمة سوقية ريال\", \"value\": \"+5 مليار\"}], \"vision\": \"تتطلع شركة القاسم العقارية إلى أن تكون إحدى أكبر الشركات على المستوى المحلي والإقليمي وذلك بفضل الله ثم بتميزها وإبداعها في الخدمات العقارية.\"}',1,2,'2026-02-13 01:43:45',NULL),(3,'services','خدماتنا','نقدم لكم أفضل الخدمات العقارية','{\"services\": [{\"description\": \"إدارة شاملة تتضمن الإشراف على صيانة العقار، تحصيل الإيجارات، والتواصل مع المستأجرين لرفع قيمة العقار وتعظيم العوائد.\", \"features\": [\"تحصيل الإيجارات\", \"الصيانة الدورية\", \"إدارة العقود\", \"التقارير المالية\"], \"title\": \"إدارة الأملاك\"}, {\"description\": \"تسويق العقار عبر القنوات الرقمية والمنصات العقارية وجذب المستأجرين والمشترين المناسبين في أسرع وقت ممكن.\", \"features\": [\"تصوير احترافي\", \"منصات رقمية\", \"حملات تسويقية\", \"تقارير الأداء\"], \"title\": \"التسويق العقاري\"}, {\"description\": \"فرص استثمارية مدروسة بعناية مع تحليل شامل للعوائد والمخاطر في السوق العقاري السعودي وتقييم احترافي للعقارات.\", \"features\": [\"تقييم العقارات\", \"تحليل العوائد\", \"دراسات الجدوى\", \"الاستشارات القانونية\"], \"title\": \"الاستشارات العقارية\"}]}',1,3,'2026-02-13 01:43:45',NULL),(4,'properties','أحدث العقارات','تصفح أحدث العقارات المتاحة','{}',1,4,'2026-02-13 01:43:22',NULL),(5,'projects','مشاريعنا','مشاريع عقارية متميزة','{}',1,5,'2026-02-13 01:43:22',NULL),(6,'partners','شركاؤنا','نفخر بشراكتنا مع أفضل الجهات','{\"partners\": [{\"nameAr\": \"بنك ساب SABB\", \"nameEn\": \"SABB Bank\"}, {\"nameAr\": \"زهران\", \"nameEn\": \"Zahran\"}, {\"nameAr\": \"عيادات أجيل\", \"nameEn\": \"Ajeel Clinics\"}, {\"nameAr\": \"بنقيث للسفر\", \"nameEn\": \"Banqeeth Travel\"}, {\"nameAr\": \"برجرايزر\", \"nameEn\": \"Burgerizer\"}, {\"nameAr\": \"مجموعة الفيصلية\", \"nameEn\": \"Al-Faisaliah Group\"}, {\"nameAr\": \"شركة الراجحي\", \"nameEn\": \"Al-Rajhi Co.\"}, {\"nameAr\": \"مجموعة بن لادن\", \"nameEn\": \"Bin Laden Group\"}]}',1,6,'2026-02-13 01:43:34',NULL),(7,'contact','تواصل معنا','نسعد بخدمتكم','{\"descriptionAr\": \"سواء كنت تبحث عن عقار للشراء أو الإيجار، أو ترغب في إضافة عقارك أو طلب استشارة عقارية، فريقنا المتخصص جاهز لمساعدتك.\", \"descriptionEn\": \"Whether you\'re looking to buy or rent a property, list your property, or request real estate consulting, our specialized team is ready to help.\"}',1,7,'2026-02-13 01:43:34',NULL),(8,'videos','جولات مرئية','الميديا','{\"videos\": [{\"descAr\": \"تعرّف على الموقع الرسمي لشركة القاسم العقارية وخدماتها المتكاملة\", \"descEn\": \"Discover the official website of Al-Qasim Real Estate and its comprehensive services\", \"thumbnail\": \"https://images.unsplash.com/photo-1600596542815-ffad4c1539a9?w=400&h=300&fit=crop\", \"titleAr\": \"جولة في منصة القاسم العقارية\", \"titleEn\": \"Tour of Al-Qasim Platform\", \"url\": \"https://files.manuscdn.com/user_upload_by_module/session_file/310519663331132774/EIHRzvxFwTzmsmtQ.mp4\"}, {\"descAr\": \"استعرض تفاصيل العقارات المعروضة للبيع والإيجار بشكل تفاعلي\", \"descEn\": \"Browse property details for sale and rent interactively\", \"thumbnail\": \"https://images.unsplash.com/photo-1600585154340-be6161a56a0c?w=400&h=300&fit=crop\", \"titleAr\": \"عرض تفصيلي للعقارات\", \"titleEn\": \"Detailed Property Showcase\", \"url\": \"https://files.manuscdn.com/user_upload_by_module/session_file/310519663331132774/RqfRkvWjgNwlFLMT.mp4\"}, {\"descAr\": \"اكتشف كيفية البحث عن العقار المثالي بسهولة وسرعة\", \"descEn\": \"Discover how to find the perfect property easily and quickly\", \"thumbnail\": \"https://images.unsplash.com/photo-1512917774080-9991f1c4c750?w=400&h=300&fit=crop\", \"titleAr\": \"البحث المتقدم عن العقارات\", \"titleEn\": \"Advanced Property Search\", \"url\": \"https://files.manuscdn.com/user_upload_by_module/session_file/310519663331132774/temOFMgPaIGIFnqT.mp4\"}, {\"descAr\": \"تعرّف على خطوات إدراج عقارك في منصة القاسم العقارية\", \"descEn\": \"Learn how to list your property on Al-Qasim platform\", \"thumbnail\": \"https://images.unsplash.com/photo-1600607687939-ce8a6c25118c?w=400&h=300&fit=crop\", \"titleAr\": \"أضف عقارك في المنصة\", \"titleEn\": \"List Your Property\", \"url\": \"https://files.manuscdn.com/user_upload_by_module/session_file/310519663331132774/QigocfeRjiiGvkYX.mp4\"}, {\"descAr\": \"استعرض أحدث المشاريع التطويرية لشركة القاسم العقارية\", \"descEn\": \"Explore the latest development projects by Al-Qasim Real Estate\", \"thumbnail\": \"https://images.unsplash.com/photo-1600566753190-17f0baa2a6c3?w=400&h=300&fit=crop\", \"titleAr\": \"مشاريع القاسم التطويرية\", \"titleEn\": \"Al-Qasim Development Projects\", \"url\": \"https://files.manuscdn.com/user_upload_by_module/session_file/310519663331132774/RyAnOABFiVshLPbz.mp4\"}, {\"descAr\": \"كيفية الاطلاع على تفاصيل العقار وحجز موعد للمعاينة\", \"descEn\": \"How to view property details and book a viewing appointment\", \"thumbnail\": \"https://images.unsplash.com/photo-1600607687644-c7171b42498f?w=400&h=300&fit=crop\", \"titleAr\": \"تفاصيل العقارات والمعاينة\", \"titleEn\": \"Property Details & Preview\", \"url\": \"https://files.manuscdn.com/user_upload_by_module/session_file/310519663331132774/EKIPdekfExquxprs.mp4\"}]}',1,8,'2026-02-13 01:43:35',NULL);
