INSERT INTO `projects` VALUES (1,'مجمع القاسم السكني',NULL,'مشروع سكني متكامل في شمال الرياض',NULL,'مجمع سكني فاخر يضم فلل وشقق بتصاميم عصرية في حي النرجس شمال الرياض. يتميز المشروع بمساحات خضراء واسعة، مسابح مشتركة، نادي صحي، ومنطقة ألعاب للأطفال.',NULL,'حي النرجس، شمال الرياض',NULL,'active',120,85,'[\"مسابح مشتركة\", \"نادي صحي\", \"حدائق\", \"أمن 24/7\", \"مواقف تحت الأرض\"]','[]',NULL,24.8200000,46.6250000,1,1,'2026-02-13 01:43:14','2026-02-14 13:03:24'),(2,'أبراج القاسم التجارية',NULL,'مشروع أبراج مكتبية في قلب الرياض',NULL,'مشروع أبراج تجارية ومكتبية في موقع استراتيجي على طريق الملك فهد. يتكون من برجين بارتفاع 30 طابقاً يضمان مكاتب إدارية فاخرة ومعارض تجارية ومطاعم.',NULL,'طريق الملك فهد، الرياض',NULL,'active',200,140,'[\"مكاتب فاخرة\", \"معارض تجارية\", \"مطاعم\", \"مواقف ذكية\"]','[\"https://files.manuscdn.com/user_upload_by_module/session_file/310519663331132774/aEePeAlkRaNzSoCz.jpg\", \"https://files.manuscdn.com/user_upload_by_module/session_file/310519663331132774/iFaIzJSQQIeJEdtW.jpg\", \"https://files.manuscdn.com/user_upload_by_module/session_file/310519663331132774/cdHgdunEoqHqhHSl.jpg\"]',NULL,24.7100000,46.6750000,2,1,'2026-02-13 01:43:14','2026-02-13 01:43:14'),(3,'واحة الياسمين',NULL,'مجمع فلل فاخرة في حي الياسمين',NULL,'مشروع فلل فاخرة بتصاميم معمارية متنوعة في حي الياسمين. كل فيلا بمسبح خاص وحديقة. المشروع يضم حديقة مركزية كبيرة ومسجد ونادي اجتماعي.',NULL,'حي الياسمين، الرياض',NULL,'active',60,45,'[\"فلل متنوعة التصاميم\", \"مسابح خاصة\", \"حديقة مركزية\", \"مسجد\", \"نادي اجتماعي\"]','[\"https://files.manuscdn.com/user_upload_by_module/session_file/310519663331132774/HSikGCXPVgTDRJdw.webp\", \"https://files.manuscdn.com/user_upload_by_module/session_file/310519663331132774/pgWVEwXSCRaVzTpf.jpg\", \"https://files.manuscdn.com/user_upload_by_module/session_file/310519663331132774/zvyZWjZcNCnaBkCn.jpg\", \"https://files.manuscdn.com/user_upload_by_module/session_file/310519663331132774/tDrFOsROgOBiqrwC.jpg\"]',NULL,24.8350000,46.6400000,3,1,'2026-02-13 01:43:15','2026-02-13 01:43:15'),(4,'منتجع القاسم البحري',NULL,'مشروع سكني سياحي على ساحل جدة',NULL,'مشروع سكني سياحي فاخر على ساحل البحر الأحمر في جدة. يضم شقق وبنتهاوس بإطلالات بحرية مباشرة. يتميز بشاطئ خاص، مارينا لليخوت، ومطاعم على الواجهة البحرية.',NULL,'كورنيش جدة، جدة',NULL,'upcoming',180,30,'[\"إطلالة بحرية\", \"شاطئ خاص\", \"مارينا\", \"مطاعم\", \"نادي صحي\"]','[\"https://files.manuscdn.com/user_upload_by_module/session_file/310519663331132774/WxlAvlsqzDFTQEaq.jpg\", \"https://files.manuscdn.com/user_upload_by_module/session_file/310519663331132774/frhPKxSQRyQkmdrD.jpg\", \"https://files.manuscdn.com/user_upload_by_module/session_file/310519663331132774/JmXXEJwpEfIRMswT.jpg\"]',NULL,21.5400000,39.1700000,4,0,'2026-02-13 01:43:15','2026-02-13 01:43:15'),(5,'حي القاسم المتكامل',NULL,'مشروع حي سكني متكامل الخدمات',NULL,'مشروع حي سكني متكامل يضم فلل وشقق ومرافق تجارية وتعليمية وصحية. تم الانتهاء من البنية التحتية وجاري تسليم الوحدات.',NULL,'شمال الرياض',NULL,'completed',500,500,'[\"مدارس\", \"مراكز صحية\", \"مراكز تجارية\", \"حدائق عامة\", \"مساجد\"]','[\"https://files.manuscdn.com/user_upload_by_module/session_file/310519663331132774/HANCUMHLBQQflvEM.jpg\", \"https://files.manuscdn.com/user_upload_by_module/session_file/310519663331132774/eugkDiWzbpQDlVnh.jpg\", \"https://files.manuscdn.com/user_upload_by_module/session_file/310519663331132774/pAjzsqnLocuHVldE.webp\"]',NULL,24.8500000,46.7000000,5,0,'2026-02-13 01:43:15','2026-02-13 01:43:15'),(6,'بوابة المستقبل',NULL,'مشروع مكاتب ذكية في الرياض',NULL,'مشروع مكاتب ذكية بتقنيات حديثة ومساحات عمل مرنة. يستهدف الشركات الناشئة والتقنية. تصميم مستدام حاصل على شهادة LEED.',NULL,'حي الغدير، الرياض',NULL,'upcoming',150,20,'[\"مساحات عمل مرنة\", \"تقنيات ذكية\", \"كافيتريا\", \"قاعات اجتماعات\"]','[\"https://files.manuscdn.com/user_upload_by_module/session_file/310519663331132774/aEePeAlkRaNzSoCz.jpg\", \"https://files.manuscdn.com/user_upload_by_module/session_file/310519663331132774/pAjzsqnLocuHVldE.webp\", \"https://files.manuscdn.com/user_upload_by_module/session_file/310519663331132774/cdHgdunEoqHqhHSl.jpg\"]',NULL,24.7800000,46.7200000,6,0,'2026-02-13 01:43:15','2026-02-13 01:43:15'),(30001,'مشروع CRUD','CRUD Project',NULL,NULL,'وصف','Desc','الرياض','Riyadh','active',100,30,NULL,NULL,NULL,NULL,NULL,0,0,'2026-02-14 02:54:21','2026-02-14 02:54:21');
