CREATE TABLE `properties` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `title` varchar(500) COLLATE utf8mb4_unicode_ci NOT NULL,
  `titleEn` varchar(500) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `description` text COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `descriptionEn` text COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `propertyType` enum('villa','apartment','land','commercial','office','building') COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT 'villa',
  `listingType` enum('sale','rent') COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT 'sale',
  `propertyStatus` enum('active','sold','rented','draft') COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT 'active',
  `price` decimal(15,2) DEFAULT NULL,
  `area` decimal(10,2) DEFAULT NULL,
  `rooms` int(11) DEFAULT NULL,
  `bathrooms` int(11) DEFAULT NULL,
  `hasParking` tinyint(1) DEFAULT '0',
  `city` varchar(100) COLLATE utf8mb4_unicode_ci DEFAULT 'الرياض',
  `cityEn` varchar(100) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `district` varchar(200) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `districtEn` varchar(200) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `address` text COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `addressEn` text COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `features` json DEFAULT NULL,
  `images` json DEFAULT NULL,
  `videoUrl` varchar(1000) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `createdBy` int(11) DEFAULT NULL,
  `createdAt` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `updatedAt` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `deletedAt` timestamp NULL DEFAULT NULL,
  `viewCount` int(11) DEFAULT '0',
  `latitude` decimal(10,7) DEFAULT NULL,
  `longitude` decimal(10,7) DEFAULT NULL,
  `floor` int(11) DEFAULT NULL,
  `direction` enum('north','south','east','west','north_east','north_west','south_east','south_west') COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `furnishing` enum('furnished','semi_furnished','unfurnished') COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `buildingAge` int(11) DEFAULT NULL,
  PRIMARY KEY (`id`) /*T![clustered_index] CLUSTERED */,
  KEY `idx_properties_status` (`propertyStatus`),
  KEY `idx_properties_type` (`propertyType`),
  KEY `idx_properties_listing` (`listingType`),
  KEY `idx_properties_city` (`city`),
  KEY `idx_properties_deleted` (`deletedAt`),
  KEY `idx_properties_created` (`createdAt`),
  KEY `idx_properties_type_city` (`propertyType`,`city`),
  KEY `idx_properties_listing_status` (`listingType`,`propertyStatus`),
  KEY `idx_properties_status_type` (`propertyStatus`,`propertyType`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci AUTO_INCREMENT=90001;
