INSERT INTO `properties` VALUES (1,'فيلا فاخرة في حي النرجس',NULL,'فيلا فاخرة بتصميم عصري في حي النرجس شمال الرياض. تتميز بمساحات واسعة وتشطيبات راقية مع حديقة خاصة ومسبح. تصميم معماري فريد يجمع بين الأصالة والحداثة مع مواد بناء عالية الجودة.',NULL,'villa','sale','active',3500000.00,450.00,6,5,1,'الرياض',NULL,'النرجس',NULL,'حي النرجس، شمال الرياض',NULL,'[\"مسبح خاص\", \"حديقة\", \"مجلس رجال\", \"مجلس نساء\", \"مصعد\"]','[\"https://files.manuscdn.com/user_upload_by_module/session_file/310519663331132774/pgWVEwXSCRaVzTpf.jpg\", \"https://files.manuscdn.com/user_upload_by_module/session_file/310519663331132774/tSVQCEBepcvJXOEB.jpg\", \"https://files.manuscdn.com/user_upload_by_module/session_file/310519663331132774/DrwDDaXKSEEesZnh.jpg\"]',NULL,NULL,'2026-02-13 01:43:10','2026-02-14 03:01:18',NULL,3,NULL,NULL,NULL,NULL,NULL,NULL),(2,'فيلا عصرية في حي الملقا',NULL,'فيلا عصرية بتصميم مودرن في أرقى أحياء شمال الرياض. تتميز بواجهة حجرية فاخرة ومدخل رخامي مهيب. تشطيبات سوبر ديلوكس مع أنظمة ذكية للإضاءة والتكييف.',NULL,'villa','sale','active',5200000.00,600.00,7,6,1,'الرياض',NULL,'الملقا',NULL,'حي الملقا، شمال الرياض',NULL,'[\"مسبح\", \"حديقة كبيرة\", \"نظام ذكي\", \"مصعد\", \"قبو\", \"غرفة سينما\"]','[\"https://files.manuscdn.com/user_upload_by_module/session_file/310519663331132774/zvyZWjZcNCnaBkCn.jpg\", \"https://files.manuscdn.com/user_upload_by_module/session_file/310519663331132774/ouzOpPOroBexOmNw.jpg\", \"https://files.manuscdn.com/user_upload_by_module/session_file/310519663331132774/tSVQCEBepcvJXOEB.jpg\"]',NULL,NULL,'2026-02-13 01:43:10','2026-02-13 01:43:10',NULL,0,NULL,NULL,NULL,NULL,NULL,NULL),(3,'فيلا دوبلكس في حي الياسمين',NULL,'فيلا دوبلكس مميزة في حي الياسمين بالرياض. مساحة مريحة وتصميم عملي يناسب العائلات. قريبة من المدارس والمراكز التجارية.',NULL,'villa','sale','active',2100000.00,350.00,5,4,1,'الرياض',NULL,'الياسمين',NULL,'حي الياسمين، شمال الرياض',NULL,'[\"مواقف سيارات\", \"حديقة\", \"مجلس\", \"مطبخ مجهز\"]','[\"https://files.manuscdn.com/user_upload_b